<script>
	import * as d3 from 'd3';
	export default {
		name: 'item-Data',
		data() {
			return {

			}
		},
		mounted() {

			let zoom = d3.zoom().on("zoom", function(event) {
				console.log(event)
				d3.select('#root').attr('transform', event.transform)
			})
			d3.select('#page1').call(zoom)
		},
		methods: {
			QueryGaoGuan(url, time) {
				axios.get(url + 'QueryGaoGuan.do', {
						params: {
							time: time,
							chaodai: 1
						}
					})
					.then(res => {
						var object = SVG.find('.objectSVG');
						for(var i = 0; i < object.length; i++) {
							object[i].remove();
						}
						for(var i = 0; i < res.data.length; i++) {
							for(var j = 0; j < person_Position.length; j++) {
								if(res.data[i].jobid == person_Position[j].jobid) {
									person_Position[j].imgURL = res.data[i].imgURL;
									person_Position[j].person_name = res.data[i].person_name;
									this.addEvent(person_Position[j].id, res.data[i]); //添加右击点击事件
									addPerson(person_Position[j]); //给人物添加名字和头像
								}
							}
						}
					})
			},
			addEvent(id, data) {
				var _this = this
				$("#" + id).attr("userid", data.userid)
				$("#" + id).bind("contextmenu", function() {
					return false;
				})
				$("#" + id).mousedown(function(e) {
					_this.userDrawer(this.getAttribute("userid"));
				})

			},
			userDrawer(userid) {
				axios.get(this.$store.state.MYURL + 'QueryPerson.do', {
						params: {
							id: userid,
						}
					})
					.then(res => {
						this.$store.commit("setDrawer", true);
						if(res.data.length != 0) {
							let data = this.dealData(res.data)
							this.$store.commit("setPersonData", data);
						} else {
							this.$store.commit("setPersonData", [{
								imgUrl: 'none.png'
							}]);
						}
					})
			},
			dealData(data) {
				for(let i = data.length - 1; i >= 0; i--) {
					if(data[i].isAllLife == "0") {
						if(moment(data[i].getTime, "YYYY-MM-DD").format("YYYYMMDD") > this.$store.state.currentTime
							//							||moment(data[i].endTime, "YYYY-MM-DD").format("YYYYMMDD") < moment(this.$store.state.currentTime).format("YYYYMMDD")
						) {
							data.splice(i, 1)
						}
					}
				}
				return data
			}
		}
