					let svgImage = document.createElementNS('http://www.w3.org/2000/svg', 'image');
					svgImage.setAttributeNS(null, 'width', data.size);
					svgImage.setAttributeNS(null, 'height', data.size);
					svgImage.setAttributeNS(null, 'x', (data.posSize - data.size) / 2);
