					svgImage.setAttribute("class", "objectSVG");

					svgImage.setAttributeNS('http://www.w3.org/1999/xlink', 'href', img);
					svgImage.setAttributeNS(null, 'visibility', 'visible');
					var text = addText((data.posSize - data.posSize / 4) / 2, data.posSize + data.posSize / 8, data.person_name, data.posSize / 8)
					$("#" + data.id).append(svgImage);
					$("#" + data.id).append(text);

					if(data.removeid) {
						$("#" + data.removeid).remove();
					}

				}, function(err) {
					console.log(err);
				});
		} else {
			var text = addText((data.posSize - data.posSize / 4) / 2, data.posSize + data.posSize / 8, data.person_name, data.posSize / 8)
			$("#" + data.id).append(text);

			if(data.removeid) {
				$("#" + data.removeid).remove();
			}
		}

	}

	function getBase64(img) { //传入图片路径，返回base64
		function getBase64Image(img, width, height) { //width、height调用时传入具体像素值，控制大小 ,不传则默认图像大小
			var canvas = document.createElement("canvas");
			canvas.width = width ? width : img.width;
			canvas.height = height ? height : img.height;

			var ctx = canvas.getContext("2d");
			ctx.drawImage(img, 0, 0, canvas.width, canvas.height);
			var dataURL = canvas.toDataURL();
			return dataURL;
		}
		var image = new Image();
		image.crossOrigin = '';
		image.src = img;
		var deferred = $.Deferred();
		if(img) {
			image.onload = function() {
				deferred.resolve(getBase64Image(image)); //将base64传给done上传处理
			}
			return deferred.promise(); //问题要让onload完成后再return sessionStorage['imgTest']
		}
	}

	function addText(x, y, val, size) {
		var text = document.createElementNS('http://www.w3.org/2000/svg', 'text');
		text.textContent = val;
		if(val.length > 2) {
			text.setAttribute("x", x - size / 4.2 * (val.length));
		} else {
			text.setAttribute("x", x);
		}
		text.setAttribute("y", y);
		text.style.setProperty("font-family", "Lishu"); //字体为宋体
		text.style.setProperty("font-size", size);
		text.style.setProperty("fill", "black");
		text.setAttribute("class", "objectSVG");
		return text;
	}
</script>